  summary: Owner of the thread processing the queue on behalf of AsyncChunkedProcessedQueue.
  remarks: >-
    The handler is designed to be used with AsyncChunkedProcessedQueue and 

    uses the QueueAsyncChunkProcessor to perform the actuall processing on 

    the queue.  All implementations need a default parameter-less constructor.
